import * as React from "react";
import { AppBar, Toolbar, Typography, Box, Button } from "@mui/material";
import { Link } from "react-router-dom";

export default function NewPage() {
  return (
    <Box
      sx={{
        width: "100%",
        height: "100vh",
        backgroundColor: "#f5f5f5",
      }}
    >
      {/* AppBar with Centered Navigation */}
      <AppBar position="static" color="default" elevation={1}>
        <Toolbar
          sx={{
            display: "flex",
            justifyContent: "center",
            alignItems: "center",
            gap: 4,
          }}
        >
          {/* Navigation Links */}
          <Button color="inherit" href="#">
            Venues
          </Button>
          <Button color="inherit" href="#">
            Hair
          </Button>
          <Button color="inherit" href="#">
            Makeup
          </Button>
          <Button color="inherit" href="#">
            Photographers
          </Button>
          <Button color="inherit" href="#">
            Music
          </Button>
        </Toolbar>
      </AppBar>

      {/* Main Content */}
      <Box
        sx={{
          display: "flex",
          alignItems: "center",
          justifyContent: "center",
          height: "calc(100vh - 64px)",
          backgroundImage: "url('https://via.placeholder.com/1600x900')",
          backgroundSize: "cover",
          backgroundPosition: "center",
          color: "#fff",
          textAlign: "center",
        }}
      >
        <Typography
          variant="h3"
          sx={{
            backgroundColor: "rgba(0, 0, 0, 0.6)",
            padding: 2,
            borderRadius: 2,
          }}
        >
          Welcome to Your New Page
        </Typography>
      </Box>

      {/* Back to Calendar Page */}
      <Box
        sx={{
          textAlign: "center",
          marginTop: 2,
        }}
      >
        <Button
          variant="contained"
          color="primary"
          component={Link}
          to="/calendar"
          sx={{ marginTop: 2 }}
        >
          Go Back to Calendar Page
        </Button>
      </Box>
    </Box>
  );
}
